import React from 'react';
import Switch from '@material-ui/core/Switch';
import { useCookies } from 'react-cookie';
import {Link} from "react-router-dom";
const Nav=()=>{
    
    const [cookies, setCookie, removeCookie] = useCookies(['cookie-name']);

        const [state, setState] = React.useState({
          checkedA: true
        });
      
        const handleChange = (event) => {
        setState({ ...state, [event.target.name]: event.target.checked });
        };           

        

    return(
        <>
         <nav className="navbar navbar-expand-md bg-dark navbar-dark navigation">
  <a className="navbar-brand" href="#">Navbar</a>
  <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#collapsibleNavbar">
    <span className="navbar-toggler-icon"></span>
  </button>
  <div className="collapse navbar-collapse" id="collapsibleNavbar">
    <ul className="navbar-nav ml-auto">
      <li className="nav-item mr-5">
        <Link className="nav-link" to="/"> { cookies.jai&&Array.isArray(cookies.jai) ? cookies.jai.map((val)=>{return(<>{val}</>)})  : <>home</> }</Link>
      </li>
      <li className="nav-item mr-5">
        <Link className="nav-link" to="/cookie">{state.checkedA?require("./dark.css"):require("./light.css")} </Link>
      </li>
      <li className="nav-item mr-5">
        <Link className="nav-link" to="/csr">CSR</Link>
      </li> 
      <li class="nav-item dropdown mr-5">
      <Link class="nav-link dropdown-toggle" to="#" id="navbardrop" data-toggle="dropdown">
      CONTACT US
      </Link>
      <div class="dropdown-menu">
        <Link class="dropdown-item" to="/local">Write To Us</Link>
      </div>
    </li>
    <li className="nav-item mr-5">
        <Link className="nav-link" to="#">P-QUERIES</Link>
      </li>
      <li className="nav-item mr-5">
      <Switch
        onChange={handleChange}
        name="checkedA"
        inputProps={{ 'aria-label': 'secondary checkbox' }}
      />
      </li>    
    </ul>
  </div>  
</nav>




        </>
    );
}

export default Nav;
